import React from 'react';
import { View, Text, Image, } from 'react-native';
import Icon from '../assets/Food.png';

function Cart(props) {
    return (
        <View style={{
            height: 190,
            margin: 10,

            shadowOffset: {
                height: 1,
                width: 1,
            },
            shadowColor: "black",
            shadowRadius: 2,
            elevation: 2,
            shadowOpacity: .5,
            borderRadius: 5,
            padding: 10,
        }}>
            <View style={{
                flexDirection: 'row',

            }}>
                <View style={{
                    margin:'4%',
                    height: 190,
                }}>
                    <Image  style={{
                    height:150,
                    width:150,
                }} source={Icon} />
                </View>
                <View>

                </View>

            </View>

        </View>
    );
}

export default Cart;
